import React from 'react'

class Formulario extends React.Component {

    handleChange = e => { console.log({name: e.target.name, value: e.target.value})}
    handleClick = e => {console.log('Button was clicked')}
    handleSumit = e => {e.preventDefault()}
    render(){
        return(

            <div className="">

                <h1>NEW ATTENDANT</h1>

                <form onSubmit={this.handelSumit}>

                    <div className="form-group">

                        <label htmlFor="">First Name</label>
                        <input onChange={this.handleChange} type="text" name="firstName"/>

                        <label >Last Name</label>
                        <input onChange={this.handleChange} className="form-control" type="text" name="lastName"/>

                        <button type="button"onClick={this.handleClick} className="btn btn-primary">Guardar</button>



                    </div>

                </form>

            </div>
        )
    }
}

export default Formulario
